                <li>Web Design with HTML & CSS</li>
                <li></li>
            </ul>
            <p>Education</p>
            <ul>
                <li>Chattahoochee Technical College</li>
                <li>Columbus State University</li>                
            </ul>  
        </div>

    );
}

export default Skills;
